package com.userdetails;

public class User {
	
	public String fName = "";
	public String lName = "";
	
	public User(String fname, String lName) {
		// TODO Auto-generated constructor stub
		this.fName = fname;
		this.lName = lName;
	}
	
	public String getFName() {
		return fName;
		
	}
	
	public String getLName() {
		return lName;
		
	}

}
